import React, { useState } from 'react';
import {
  Box,
  Container,
  Typography,
  Grid,
  Paper,
  Avatar,
  Tab,
  Tabs,
  Button,
  Divider,
  Card,
  CardContent,
  Chip,
} from '@mui/material';
import {
  Person,
  ShoppingBag,
  Favorite,
  Settings,
  LocalShipping,
  CheckCircle,
  Schedule,
} from '@mui/icons-material';

// Mock data for orders (replace with actual data from your backend)
const mockOrders = [
  {
    id: 'ORD001',
    date: '2025-03-15',
    status: 'Delivered',
    total: 15999,
    items: [
      {
        name: 'Matrix Phoenix Refractor Telescope',
        quantity: 1,
        price: 15999,
        image: '/images/telescope-bg.jpg',
      },
    ],
  },
  {
    id: 'ORD002',
    date: '2025-03-10',
    status: 'Processing',
    total: 4998,
    items: [
      {
        name: 'NASA Space Hoodie',
        quantity: 2,
        price: 2499,
        image: '/images/merch-bg.jpg',
      },
    ],
  },
];

const TabPanel = ({ children, value, index }) => (
  <div hidden={value !== index} style={{ width: '100%' }}>
    {value === index && children}
  </div>
);

const Profile = () => {
  const [tabValue, setTabValue] = useState(0);

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'Delivered':
        return '#00FF88';
      case 'Processing':
        return '#48CAE4';
      case 'Cancelled':
        return '#FF4D6D';
      default:
        return '#CAF0F8';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'Delivered':
        return <CheckCircle sx={{ color: '#00FF88' }} />;
      case 'Processing':
        return <LocalShipping sx={{ color: '#48CAE4' }} />;
      default:
        return <Schedule sx={{ color: '#CAF0F8' }} />;
    }
  };

  return (
    <Box
      sx={{
        minHeight: '100vh',
        background: 'linear-gradient(to bottom, #03071E, #000814)',
        position: 'relative',
        py: 8,
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          background: 'url(/images/stars-bg.png) repeat',
          opacity: 0.5,
          animation: 'twinkle 8s linear infinite',
          pointerEvents: 'none',
        },
      }}
    >
      <Container sx={{ position: 'relative' }}>
        <Grid container spacing={4}>
          {/* Profile Header */}
          <Grid item xs={12}>
            <Paper
              sx={{
                p: 4,
                background: 'rgba(255, 255, 255, 0.05)',
                backdropFilter: 'blur(10px)',
                border: '1px solid rgba(255, 255, 255, 0.1)',
                borderRadius: 4,
                display: 'flex',
                alignItems: 'center',
                gap: 3,
              }}
            >
              <Avatar
                sx={{
                  width: 100,
                  height: 100,
                  bgcolor: '#48CAE4',
                  border: '4px solid rgba(72, 202, 228, 0.3)',
                }}
              >
                <Person sx={{ fontSize: 50 }} />
              </Avatar>
              <Box>
                <Typography variant="h4" sx={{ color: '#CAF0F8', mb: 1 }}>
                  John Doe
                </Typography>
                <Typography variant="body1" sx={{ color: '#CAF0F8', opacity: 0.8 }}>
                  john.doe@example.com
                </Typography>
              </Box>
            </Paper>
          </Grid>

          {/* Tabs Navigation */}
          <Grid item xs={12}>
            <Paper
              sx={{
                background: 'rgba(255, 255, 255, 0.05)',
                backdropFilter: 'blur(10px)',
                border: '1px solid rgba(255, 255, 255, 0.1)',
                borderRadius: 4,
              }}
            >
              <Tabs
                value={tabValue}
                onChange={handleTabChange}
                variant="fullWidth"
                sx={{
                  '& .MuiTab-root': {
                    color: '#CAF0F8',
                    opacity: 0.7,
                    '&.Mui-selected': {
                      color: '#48CAE4',
                      opacity: 1,
                    },
                  },
                  '& .MuiTabs-indicator': {
                    backgroundColor: '#48CAE4',
                  },
                }}
              >
                <Tab icon={<ShoppingBag />} label="Orders" />
                <Tab icon={<Favorite />} label="Wishlist" />
                <Tab icon={<Settings />} label="Settings" />
              </Tabs>
            </Paper>
          </Grid>

          {/* Tab Content */}
          <Grid item xs={12}>
            <TabPanel value={tabValue} index={0}>
              <Typography variant="h5" sx={{ color: '#CAF0F8', mb: 3 }}>
                Order History
              </Typography>
              <Grid container spacing={3}>
                {mockOrders.map((order) => (
                  <Grid item xs={12} key={order.id}>
                    <Card
                      sx={{
                        background: 'rgba(255, 255, 255, 0.05)',
                        backdropFilter: 'blur(10px)',
                        border: '1px solid rgba(255, 255, 255, 0.1)',
                        borderRadius: 4,
                      }}
                    >
                      <CardContent>
                        <Box sx={{ mb: 2, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                          <Typography variant="h6" sx={{ color: '#CAF0F8' }}>
                            Order #{order.id}
                          </Typography>
                          <Chip
                            icon={getStatusIcon(order.status)}
                            label={order.status}
                            sx={{
                              bgcolor: 'rgba(255, 255, 255, 0.1)',
                              color: getStatusColor(order.status),
                              borderRadius: 2,
                            }}
                          />
                        </Box>
                        <Typography variant="body2" sx={{ color: '#CAF0F8', opacity: 0.8, mb: 2 }}>
                          Ordered on {new Date(order.date).toLocaleDateString()}
                        </Typography>
                        <Divider sx={{ my: 2, borderColor: 'rgba(255, 255, 255, 0.1)' }} />
                        {order.items.map((item, index) => (
                          <Box key={index} sx={{ display: 'flex', gap: 2, mb: 2 }}>
                            <Box
                              component="img"
                              src={item.image}
                              alt={item.name}
                              sx={{
                                width: 80,
                                height: 80,
                                borderRadius: 2,
                                objectFit: 'cover',
